<script>
var mod1 = angular.module('mod1', []);

mod1.constant('MYNAME','KRISDA DOI');


var app = angular.module('app', ['mod1']);
app.constant('MYNAME','NUNTIPUT JJJJJJJ');
app.directive('toggle', function() {
  return {
	restrict: 'A',
	link:function(scope,element,attr){
		var str=attr.toggle || '';
		if(str=='popover') angular.element(element).popover();
		if(str=='tooltip') angular.element(element).tooltip();
	}
  }
});
app.run(function($rootScope, $compile, MYNAME){
	var elms={};
	$rootScope.appName='Krisda App'
	$modalScope=$rootScope.$new();
	
	$rootScope.krisda='Helow Krisda Junkhao';

	$rootScope.getName=function(){
	
		var ij=angular.injector();
		console.dir(ij.has('MYNAME'));
		//console.dir(ij.get('MYNAME'));
		return MYNAME;
	}
		
	$rootScope.openPopup=function(elm){
		var el=null;
		if(elms[elm]){
			el=elms[elm];
			if(angular.isString(el)){
				el=$compile(el)($modalScope);
				
			}
			
			
		}else{
			el=$(elm);
			if(el.length){
				if(el.prop('tagName')=='SCRIPT'){
					var sc=el;
					var htm=sc.html();
					el=$compile(htm)($modalScope);
					sc.remove();
					elms[elm]=htm;
					
				}
				
			}else{
				el=null;
			}
		}
		if(el){
			$('[data-toggle="popover"]',el).popover();
			el.on('show.bs.modal',function(){
				$modalScope.$elm=el;

				$modalScope.$hide=function(){

					if($modalScope.$elm){
						$modalScope.$elm.modal('hide');
						$modalScope.$elm=null;
					}
				}			
				el.off('show.bs.modal').on('hidden.bs.modal',function(){
					$('[data-toggle="popover"]',el).popover('hide');
					el.off('hidden.bs.modal');
					el.remove();
					$modalScope.$broadcast('$destroy');
					
				});
				
				
				
				
			});
	
			el.modal('show');
		
		}
	}
});

